import React from 'react'
import Skill from './Skill'
import './Skillbar.css'

function importAll(r) {
    let images = {};
    r.keys().map((item, index) => { images[item.replace('./', '')] = r(item); });
    return images;
}
function Skillbar() {

    const images = importAll(require.context('./images/Skills', false, '/\.svg/'));
    return (
        <div className="Skillbar">
            <ul className="Skills-container">
                <li className="Skill">
                    <Skill src={images[0]} />
                </li>
                <li className="Skill" >
                    <Skill src={images[1]}/>
                </li>
                <li className="Skill" >
                    <Skill  src={images[2]}/>
                </li>
            </ul>
        </div>
    )
}

export default Skillbar
